import './Detail.css'
import { useParams, Link } from 'react-router-dom'
import {useState, useEffect} from 'react'
import axios from 'axios'

import imagennull from '../../img/ayuda/image.png'


const Detail = () => {
    const [juego, setJuego] = useState({});
    const { id } = useParams();

    useEffect(() => {
        const fetchData = async () => {
            try {
                const endpoint = `http://localhost:3001/dogs/${id}`;
                const response = await axios.get(endpoint);
                const { datos } = response.data;

                setJuego(datos);
                console.log("Datas: " + JSON.stringify(datos));
            } catch (error) {
                console.error('Error al mostrar Juegos:', error);
            }
        };

        fetchData();
    }, [id]);

    const handleImage = (img1) => {
        const imageExtensions = ['.png', '.jpg', '.jpeg', '.gif'];

        const isValid = (imagen) => {
            if (!imagen) return false;
            const lowerCaseUrl = imagen.toLowerCase();
            return imageExtensions.some(ext => lowerCaseUrl.endsWith(ext));
        };

        const img1Valid = isValid(img1);

        return img1Valid ? img1 : imagennull;
    };

    return (
        <div className="containerDetail">
            <div className='izquierda'>
                <img src={handleImage(juego.url)} alt={juego.name} className='imagen_dogs' />
            </div>
            <div className='derecha'>
                <div className='Gurpo_dogs'>
                    <h3>{juego.breeds?.[0]?.name} <Link to={'/home'}><div>X</div></Link></h3>
                    
                </div>
                <p></p>
               

                <div className='Gurpo_dogs'>
                id: {juego.id}
                <br/>
                breed_group: {juego.breeds?.[0]?.breed_group}
                <br/>
                life_span : {juego.breeds?.[0]?.life_span}
                </div>


                <div className='Gurpo_dogs'>
                temperament: <ul>
                    {juego.breeds?.[0]?.temperament?.split(',').map((temperamento, index) => (
                        <li key={index}>{temperamento.trim()}</li>
                    ))}
                </ul>
                </div>
                <div className='Gurpo_dogs'>Weight: 
                  <ul><li>imperial {juego.breeds?.[0]?.weight?.imperial}</li>
                  <li>metric {juego.breeds?.[0]?.weight?.metric}</li>
                  </ul>
                </div>
                <div className='Gurpo_dogs'>height: 
                  <ul><li>imperial {juego.breeds?.[0]?.height?.imperial}</li>
                  <li>metric {juego.breeds?.[0]?.height?.metric}</li>
                  </ul>
                </div>

                <div className='Gurpo_dogs'>
                temperament: <ul>
                    {juego.breeds?.[0]?.bred_for?.split(',').map((bred_for, index) => (
                        <li key={index}>{bred_for.trim()}</li>
                    ))}
                </ul>
                </div>


                {/* Otros datos que quieras mostrar */}
            </div>
        </div>
    );
};
export default Detail;
